description:
Thinking of You is a collection of stunning European talent brought together in a couple friendly release for Daring Pure.
Intimate moments shared between two people as their intense lovemaking is captured in a natural style, unassuming style.
British Director Disanto lends his trademark cinematic style to this high end Daring Pure production.
